import React from 'react'
import Todo from './Todo'

const Todos = (props) => {
  return (
    <section>
        {
            props.todosList.map((item,i)=>{
                return (
                    <Todo key={i} todo={item}/>
                )
            })
        }
      
    </section>
  )
}

export default Todos
